CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "user_house" ("house_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "area" integer NOT NULL, "floor" integer NOT NULL, "district" varchar(50) NOT NULL, "city" varchar(50) NOT NULL, "state" varchar(50) NOT NULL, "cost" integer NOT NULL, "bedrooms" integer NOT NULL, "hall" bool NOT NULL, "balcany" bool NOT NULL, "desc" varchar(200) NOT NULL, "AC" bool NOT NULL, "img" varchar(100) NOT NULL, "date" date NOT NULL, "user_email_id" varchar(100) NULL REFERENCES "user_user" ("email") DEFERRABLE INITIALLY DEFERRED, "booked" bool NOT NULL, "kitchen" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "user_room" ("room_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "dimention" varchar(100) NOT NULL, "district" varchar(50) NOT NULL, "city" varchar(50) NOT NULL, "state" varchar(50) NOT NULL, "cost" integer NOT NULL, "bedrooms" integer NOT NULL, "hall" bool NOT NULL, "balcany" bool NOT NULL, "desc" varchar(200) NOT NULL, "AC" bool NOT NULL, "img" varchar(100) NOT NULL, "date" date NOT NULL, "user_email_id" varchar(100) NULL REFERENCES "user_user" ("email") DEFERRABLE INITIALLY DEFERRED, "booked" bool NOT NULL, "kitchen" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "user_booking" ("booking_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "house_id" integer NULL REFERENCES "user_house" ("house_id") DEFERRABLE INITIALLY DEFERRED, "customer_id" varchar(100) NOT NULL REFERENCES "user_user" ("email") DEFERRABLE INITIALLY DEFERRED, "date" date NOT NULL, "room_id" integer NULL REFERENCES "user_room" ("room_id") DEFERRABLE INITIALLY DEFERRED, "booked" bool NOT NULL);
